import React from "react";
import {Link} from "react-router-dom";
const {useState, useEffect} = React;

export default function Signup() {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [username, setUsername] = useState("");
    const [repeatPass, setRepeatPass] = useState("");
    const handleUserSignup = (e) => {
        e.preventDefault();

    }
    return (
        <div className="signup">
            <form onSubmit={handleUserSignup}>
                <h1>Sign Up</h1>
                <input type="test" placeholder="Full Name..." value={username} onChange={e => setUsername(e.target.value)} required/>
                <input type="email" placeholder="Email..." value={email} onChange={e => setEmail(e.target.value)} required/>
                <input type="password" placeholder="Password..." value={password} onChange={e => setPassword(e.target.value)} required />
                <input type="password" placeholder="Repeat Password..." value={repeatPass} onChange={e => setRepeatPass(e.target.value)} required />

                <button type="submit">Sign Up</button>
                <p>Having an account? <Link to={"/login"}>Login</Link></p>
            </form>
        </div>
    )
}
